import React from 'react'
import { Link } from 'react-router-dom';
import './Calculadora.css'
import Button from './Boton'
import './Home.css'

class Home extends React.Component {
    render() {
        return (
            <div id="calculadora">
                <h2 id="home__home">Rolgus Tool-Box</h2>
                <Link to="/Portales">
                    <div onClick={this.onClick} className="boton__home">
                        <Button name="Enlazar Portales" />
                    </div>
                </Link>
                <Link to="/RestBlocks">
                    <div onClick={this.onClick} className="boton__home">
                        <Button name="Distancias" />
                    </div>
                </Link>
                <Link to="/Circulos"><div onClick={this.onClick} className="boton__home"><Button name="Circulos(en desarrollo)"/></div></Link>
            </div>
        )
    }
}


export default Home;
